  \"2016-08-18T08:19:40.169328\",\n\t\"name\": \"ordinance-violations-buildings\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"List of ordinance violations filed with
  the Department of Administrative Hearings. This data set reflects violations brought
  before the Chicago Department of Administrative Hearings.  It does not reflect violations
  brought before the Circuit Court of Cook County. Each row of data represents a unique
  violation. Multiple violations may be associated with a single case. The most recent
  status of the case is shown in the dataset and is updated daily. Hearing date corresponds
  to the date of the most recent hearing. Each case often consists of multiple hearings
  and may encounter continuances due to various circumstances before a final disposition
  is rendered. The case disposition, date of the disposition, and any applicable fines
  and administrative costs are listed when the case is fully completed. The latest
  hearing status or disposition reflects the condition of the property at that time
  and may not reflect the current condition of the property. When multiple respondents
  are cited, each respondent is separated by a pipe (\"|\") character. Respondents
  sometimes are added to cases for technical legal reasons so are not necessarily
  the parties believed to have committed the violations. This dataset currently lists
  violations issued by the Department of Buildings. Additional ordinance violations
  will be added over time.  Therefore, it is advisable to use the department-specific
  filtered view listed under the More Views button for purposes that require only
  one department's violations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
